import React, { useState } from 'react';
import axios from 'axios';
import './cadastro.css';

function Cadastro() {
  const [nome, setNome] = useState('');
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [cpf, setCpf] = useState('');
  const [cep, setCep] = useState('');
  const [rua, setRua] = useState('');
  const [numero, setNumero] = useState('');
  const [bairro, setBairro] = useState('');
  const [cidade, setCidade] = useState('');
  const [estado, setEstado] = useState('');

  const mudarCep = (evento) => {
    setCep(evento.target.value);
  };

  const buscarEndereco = async () => {
    try {
      const busca = await axios.get(`https://viacep.com.br/ws/${cep}/json/`);
      setBairro(busca.data.bairro);
      setCidade(busca.data.localidade);
      setEstado(busca.data.uf);
      setRua(busca.data.logradouro);
      if (busca.data.erro) {
        setRua('');
        setNumero('');
        setBairro('');
        setCidade('');
        setEstado('');
      }
    } catch (err) {
      console.log(err);
    }
  };

  const registrar = async (e) => {
    e.preventDefault();
    try {
      const resposta = await axios.post('http://localhost:5000/cadastrar', {
        nome,
        email,
        senha,
        cpf,
        cep,
        rua,
        bairro,
        cidade,
        estado,
        numero,
      });

      setNome('');
      setEmail('');
      setSenha('');
      setCpf('');
      setCep('');
      setRua('');
      setNumero('');
      setBairro('');
      setCidade('');
      setEstado('');

      alert(resposta.data.msg);
      console.log(resposta.data);
    } catch (err) {
      alert(err.request.responseText);
      console.log(err.request.responseText);
    }
  };

  return (
    <div>
      <div className="title-container">
        <h1> Faça seu Cadastro </h1>
        <img src="/public/img/usuario.gif" alt="GIF" />
      </div>

      {/* Resto do código do formulário */}
    </div>
  );
}

export default Cadastro;
